import React from 'react';

export const TableRow = ({ data }) => {
  return (
    <tr>
      <td>{data.indicator}</td>
      <td>{data.today}</td>
      <td>{data.yesterday}</td>
      <td>{data.this - day}</td>
    </tr>
  );
};
